import React from 'react';
import { useTable } from "react-table";


const data = [
    { district: "Wan Chai", building: "Block C, Villa Lotto", cases: "2", ages: ["21", "24"], resident: "HK Resident", date: "05/03/2020" },
    { district: "Tai Po", building: "Tower 1, La Grove", cases: "1", ages: ["45"], resident: "Non-local", date: "05/04/2020" },
    { district: "Central and Western", building: "18 Stanley Main Street", cases: "1", ages: ["33"], resident: "HK Resident", date: "11/03/2020" },
    { district: "Wan Chai", building: "Block C, Villa Lotto", cases: "2", ages: ["21", "24"], resident: "HK Resident", date: "05/03/2020" },
    { district: "Tai Po", building: "Tower 1, La Grove", cases: "1", ages: ["45"], resident: "Non-local", date: "05/04/2020" },
    { district: "Central and Western", building: "18 Stanley Main Street", cases: "1", ages: ["33"], resident: "HK Resident", date: "11/03/2020" },
    { district: "Wan Chai", building: "Block C, Villa Lotto", cases: "2", ages: ["21", "24"], resident: "HK Resident", date: "05/03/2020" },
    { district: "Tai Po", building: "Tower 1, La Grove", cases: "1", ages: ["45"], resident: "Non-local", date: "05/04/2020" },
    { district: "Central and Western", building: "18 Stanley Main Street", cases: "1", ages: ["33"], resident: "HK Resident", date: "11/03/2020" },
];


const columns = [
    {
        Header: "District",
        accessor: "district"
    },
    {
        Header: "Building",
        accessor: "building"
    },
    {
        Header: "Case No.",
        accessor: "cases"
    },
    {
        Header: "Ages",
        accessor: "ages"
    },
    {
        Header: "HK/Non-HK Resident",
        accessor: "resident"
    },
    {
        Header: "Date",
        accessor: "date"
    }
]


const TableData = () => {

    const {
        getTableProps,
        getTableBodyProps,
        headerGroups,
        rows,
        prepareRow
    } = useTable({
        columns,
        data
    })


    return (
        <table {...getTableProps()}>
            <thead>
                {headerGroups.map(headerGroup => (
                    <tr {...headerGroup.getHeaderGroupProps()}>
                        {headerGroup.headers.map(column => (
                            <th {...column.getHeaderProps()}>{column.render("Header")}</th>
                        ))}
                    </tr>
                ))}
            </thead>
            <tbody {...getTableBodyProps()}>
                {rows.map((row, i) => {
                    prepareRow(row);
                    return (
                        <tr {...row.getRowProps()}>
                            {row.cells.map(cell => {
                                return <td {...cell.getCellProps()}>{cell.render("Cell")}</td>;
                            })}
                        </tr>
                    );
                })}
            </tbody>
        </table>
    )

}

export default TableData;
